//https://leetcode.com/problems/substring-with-concatenation-of-all-words
class Solution {
public:
    vector<int> findSubstring(string s, vector<string>& words) {
        vector<int> res;
        unordered_map<string, int> m_word;
        int total_len = words.size()*words[0].size();
        int word_len = words[0].size();
        if(total_len > s.size())
            return res;
        for(auto word: words){
            m_word[word]++;
        }
        for(int i=0; i<word_len; i++){
            unordered_map<string, int> m_window;
            int start = i;
            int end = i;
            int count = 0;

            while(start <= end && end <= s.size() - word_len){
                string temp = s.substr(end, word_len);
                if(m_word.count(temp)){
                    m_window[temp]++;
                    if(m_window[temp] == m_word[temp]){
                        count++;
                    }
                    while(m_window[temp] > m_word[temp]){
                        string temp_start = s.substr(start, word_len);
                        if(m_window[temp_start] == m_word[temp_start]){
                            count--;
                        }
                        m_window[temp_start]--;
                        start = start+word_len;
                    }
                    end = end + word_len;
                    if(count == m_word.size()){
                        res.push_back(start);
                        string temp_start = s.substr(start, word_len);
                        m_window[temp_start]--;
                        count--;
                        start += word_len;
                    }
                }else{
                    //reset
                    end += word_len;
                    start = end;
                    count = 0;
                    m_window.clear();
                }
            }
        }
        return res;
    }
};
